import React, { Component } from 'react'
import Layout from '../components/mapLayout'


export class map extends Component {
    render() {
        return (
         <Layout>
             <div className = "container-fluid h-100">
                 <div className = "row">
                 </div>
             </div>
         </Layout>
        )
    }
}

export default map
